import Header from "./Header";
import FrontPage from "./Home/FrontPage";
import Products from "./Home/Products";
import Client from "./Client";

const Home = () => {
  return (
    <div>
      <Header />
      <FrontPage />
      <Products />
      <Client />
    </div>
  );
};

export default Home;
